import React, { useState } from 'react';

const Form: React.FC = () => {
    const [type, setType] = useState<string>('');
    const [lat, setLat] = useState<number>(0);
    const [long, setLong] = useState<number>(0);

    const handleSubmit = (e: React.FormEvent) => {
        e.preventDefault();
        console.log(type, lat, long);
    }

    return (
        <form onSubmit={handleSubmit}>

            <input type="text" label="Food Type" onChange={e => setType(e.target.value)} />
            <input type="number"  onChange={e => setLat(parseInt(e.target.value))} />
            <input type="number"  onChange={e => setLong(parseInt(e.target.value))} />
            <button type="submit">Submit</button>
        </form>
    )
}

export default Form;
